 p_id=>wwv_flow_imp.id(6552118846743472)
,p_process_sequence=>1
,p_process_point=>'AFTER_LOGIN'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'populate_default_du'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'begin',
'  select du.du_name,',
'         du.du_cd,',
'         du.du_3letter_code,',
'         ud.app_cd',
'    into :G_DU_NAME,',
'         :G_DU_CD,',
'         :G_DU_3LETTER_CODE,',
'         :G_APP_CD',
'    from cisadm_apps.app_user_du_privs ud',
'   inner join cisadm_apps.app_du_codes du',
'      on du.du_cd = ud.du_cd',
'   where ud.prim_du_sw = ''Y''',
'     and ud.username = upper(:APP_USER)',
'     and ud.app_cd = ''IMP''',
'     and rownum = 1;',
'exception',
'  when others then',
'    :G_DU_NAME := null;',
'    :G_DU_CD   := null;',
'    :G_DU_3LETTER_CODE := null;',
'    :G_APP_CD  := null;',
'end;'))
,p_process_clob_language=>'PLSQL'
);
end;
